void ClearLCD()
{
	LcdCmdEnable();
	HAL_SPI_Transmit(&hspi2, &LCD_CMD_CLEAR, 1, 0);
	HAL_SPI_Transmit(&hspi2, &LCD_CMD_NOP, 1, 0);
	HAL_Delay(1);
	LcdCmdDisable();
}

void OutputBuff()
{
	LcdCmdEnable();
	HAL_SPI_Transmit(&hspi2, &LCD_CMD_UPDATE, 1, HAL_MAX_DELAY);
	for(uint8_t line = 0; line < 240; line++) {
		uint8_t tmp = line + 1;
		HAL_SPI_Transmit(&hspi2, &tmp, 1, 0);
		for(uint8_t row = 0; row < 50; row++) {
			tmp = ~LCD_BUFF[line][row];
  		HAL_SPI_Transmit(&hspi2, &tmp, 1, HAL_MAX_DELAY);
		}
  	HAL_SPI_Transmit(&hspi2, &LCD_CMD_NOP, 1, HAL_MAX_DELAY);
	}
	HAL_SPI_Transmit(&hspi2, &LCD_CMD_NOP, 1, HAL_MAX_DELAY);
	HAL_SPI_Transmit(&hspi2, &LCD_CMD_NOP, 1, HAL_MAX_DELAY);
	HAL_Delay(1);
	LcdCmdDisable();
}

void OutputTest()
{
	LcdCmdEnable();
	uint8_t receiveData[100] = {0};
	HAL_SPI_TransmitReceive(&hspi2, &LCD_CMD_UPDATE, receiveData, 1, HAL_MAX_DELAY);
  uint8_t tmp = 120; // 0b11110000
	uint8_t test_data[50] = {0};
	test_data[0] = 0x40; // 0b01000111
	test_data[1] = 0x41;
	test_data[2] = 0x42;
	test_data[3] = 0x43;
	test_data[4] = 0x44;
	test_data[5] = 0x45;
	test_data[6] = 0x46;
	HAL_SPI_Transmit(&hspi2, &tmp, 1, HAL_MAX_DELAY);
	HAL_SPI_Transmit(&hspi2, test_data, 50, HAL_MAX_DELAY);
	HAL_SPI_Transmit(&hspi2, &LCD_CMD_NOP, 1, HAL_MAX_DELAY);
	HAL_SPI_Transmit(&hspi2, &LCD_CMD_NOP, 1, HAL_MAX_DELAY);
	HAL_Delay(1);
	LcdCmdDisable();
}
